import React from "react";

const Detail = () => {
  return (
    <div className="border" style={{ width: 300, height: 50 }}>
      Hi
    </div>
  );
};
export const FullHome = () => {
  return <Detail />;
};

export const Bathroom = () => {
  return (
    <div className="border" style={{ width: 100, height: 100 }}>
      <h1>Bathroom</h1>
    </div>
  );
};
